import { Component } from "react";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Home from "./pages/Home";
import Contact from "./pages/Contact";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        {/* <Routes> */}
          <Route path="/" element={<Home />}>
          </Route>
          <Route path="/contact" element={<Contact />}>
          </Route>
        {/* </Routes> */}
       </BrowserRouter>
    )
  };
};

export default App;
